CREATE TABLE avocado_sales(
   date           DATE  NOT NULL PRIMARY KEY
  ,AveragePrice   NUMERIC(4,2) NOT NULL
  ,Total_Avocados INTEGER  NOT NULL
  ,Small_4046     INTEGER  NOT NULL
  ,Large_4225     INTEGER  NOT NULL
  ,XLarge_4770    INTEGER  NOT NULL
  ,Small_Bags     INTEGER  NOT NULL
  ,Large_Bags     INTEGER  NOT NULL
  ,XLarge_Bags    INTEGER  NOT NULL
  ,Total_Bags     INTEGER  NOT NULL
  ,type           VARCHAR(12) NOT NULL
  ,Cities         VARCHAR(19) NOT NULL
);
